import { HashRouter, Route, Link, Routes} from "react-router-dom";
import React, { Component } from 'react';
import Developing from "./Components/Pages/Developing";
import Homepage from "./Components/Pages/Hompage";
import Business from "./Components/Pages/Business";
import BostonBusiness from "./Components/Pages/BostonBusiness";


class App extends Component {
  render() {
    return (
      <HashRouter basename="/">
        <div>
          <ul>
            <li><Link to="/se-bpda-main-streets/">Homepage</Link></li>
            <li><Link to="/se-bpda-main-streets/business">BostonBusiness</Link></li>
          </ul>
          <hr />
          <Routes>
            <Route exact path="/se-bpda-main-streets/" component={Homepage} />
            <Route path="/se-bpda-main-streets/business" component={BostonBusiness} />
          </Routes>
        </div>
      </HashRouter>
    );
  }
}
